import "./App.css";
import "typeface-roboto";
import React, { useState } from "react";
import imyz from "./images/s.png";
import imyzd from "./images/sd.png";
import {
  useTheme,
  Paper,
  useMediaQuery,
  Grid,
  makeStyles,
  createMuiTheme,
  responsiveFontSizes,
  Typography,
  MuiThemeProvider,
} from "@material-ui/core";
/** import Option from "./appsnpm startet/Option"; */
/** import { PcLogin, MobileLogin } from "./appset/Login"; */

function App(): JSX.Element {
  const [darkmode, setDarkmode] = useState(true);

  interface ITodo {
    text: string;
    complete: boolean;
  }

  const word = {
    hh: "hi",
  };

  alert(word.hh);

  var shade = "";
  var shade2 = "";
  var shade2num = "";
  var shade2nump = "";
  var logoimage = imyz;
  var secondarymaincolor = "";
  var maincolor = "";
  var shade2nump22 = "";

  if (darkmode) {
    shade2nump22 = "5.5";
    shade = "#cccccc";
    shade2 = "#cccccc";
    shade2num = "1.1";
    shade2nump = "1.8";
    logoimage = imyzd;
    secondarymaincolor = "#ffffff";
    maincolor = "#ffffff";
  } else {
    shade2nump22 = "8";
    shade = "#0b1728";
    shade2 = "#0b1728";
    shade2num = "1.5";
    shade2nump = "1.5";
    logoimage = imyz;
    secondarymaincolor = "#0b1728";
    maincolor = "#0b1728";
  }

  let themeGeneralSettings = createMuiTheme({
    palette: {
      background: {
        paper: darkmode ? "#282c34" : "#ffffff",
      },
      primary: {
        main: `${maincolor}`,
      },
      secondary: {
        main: `${secondarymaincolor}`,
      },
      type: darkmode ? "dark" : "light",
    },
  });

  const themeresponsivefont = responsiveFontSizes(themeGeneralSettings);
  var useStyle = makeStyles((themeresponsivefont) => ({
    icon: {
      [themeGeneralSettings.breakpoints.up("xs")]: {
        objectFit: "contain",
        width: "78%",
        paddingLeft: "1.5vw",
      },
      [themeGeneralSettings.breakpoints.up("sm")]: {
        objectFit: "contain",
        width: "85%",
      },
      [themeGeneralSettings.breakpoints.up("md")]: {
        objectFit: "contain",
        width: "60%",
      },
    },

    h1: {
      [themeGeneralSettings.breakpoints.up("xs")]: {
        fontFamily: "BROADW",
        fontSize: "9.8vw",
      },
      [themeGeneralSettings.breakpoints.up("sm")]: {
        fontFamily: "BROADW",
        fontSize: "8vw",
      },
      [themeGeneralSettings.breakpoints.up("md")]: {
        fontFamily: "BROADW",
        fontSize: "5.8vw",
      },
    },

    buttonmobile: {
      [themeGeneralSettings.breakpoints.up("xs")]: {
        padding: "8.5px",
        borderRadius: "20px",
        fontSize: "13px",
        mozBoxShadow: `0 0 ${shade2num}px ${shade2} `,
        webkitBoxShadow: `0 0 ${shade2num}px ${shade2} `,
        boxShadow: `0 0 ${shade2num}px ${shade2} `,
      },
    },

    buttonmobile2: {
      [themeGeneralSettings.breakpoints.up("xs")]: {
        padding: "10.5px",
        borderRadius: "20px",
        fontSize: "13px",
        mozBoxShadow: `0 0 4.5px ${shade}`,
        webkitBoxShadow: `0 0 4.5px ${shade} `,
        boxShadow: `0 0 4.5px ${shade}`,
      },
    },
    buttonpc: {
      [themeGeneralSettings.breakpoints.up("xs")]: {
        padding: "9px",
        borderRadius: "6.5px",
        mozBoxShadow: `0 0 ${shade2nump}px  ${shade}`,
        webkitBoxShadow: `0 0 ${shade2nump}px  ${shade}`,
        boxShadow: `0 0 ${shade2nump}px  ${shade}`,
      },
    },
    buttonpc2: {
      [themeGeneralSettings.breakpoints.up("xs")]: {
        padding: "9px",
        borderRadius: "6.5px",
        mozBoxShadow: `0 0  ${shade2nump22}px  ${shade}`,
        webkitBoxShadow: `0 0  ${shade2nump22}px  ${shade}`,
        boxShadow: `0 0  ${shade2nump22}px  ${shade}`,
      },
    },
  }));
  var classes = useStyle();

  return (
    <MuiThemeProvider theme={themeGeneralSettings}>
      <Paper
        className="fadeboyin"
        style={{ height: "97.5vh", borderRadius: "0px" }}
      >
        {" "}
        <h1>get it</h1>{" "}
      </Paper>
    </MuiThemeProvider>
  );
}

export default App;
